import React from 'react';
import './App.css';

class Square extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            value: props.value,
        };
    }

    render() {
        return (
            <button className="Square" onclick={()=>this.setState({value:'X'})}>
                {value}
            </button>
        );
    }
}

class App extends React.Component {

    render(){
        return (
            <div>
                <Square/>
            </div>
        );
    }
}

export default App;
